De consulaire ambtenaren, belast met de leiding van de Nederlandse consulaire vertegenwoordiging te Genève waren:   


K.W. Vermaire, (honorair) consul bij KB van 25/2/1908, nr. 48, ontslagen bij KB van 15/9/1919, nr. 34; sinds 1903 werkzaam te Genève als vice-consul;


J.C. van Notten, (honorair) consul, benoemd bij KB van 9/10/1919, nr. 36, met de persoonlijke titel van consul-generaal bij KB van 1/6/1939, nr. 17, ontslagen bij KB van 20/2/1948, nr. 39;


jhr. C.H.C. Flugi van Aspermont, (honorair) consul bij KB van 20/2/1948, nr. 39, overleden op 6/7/1961 (tevens vertegenwoordiger in Zwitserland van het Nederlandse Rode Kruis);


mr. A. Furnée, consul-generaal, benoemd bij KB van 23/12/1961, nr. 118, overleden op 18/7/1964;


M.J. van Schreven: benoemd bij KB van 12/9/1964, nr. 1946, werkzaam tot ongeveer juni 1968;


J.B. Haverkorn van Rijsewijk, benoemd bij KB van 17 juni 1968, nr. 72, werkzaam tot ongeveer januari/februari 1971;


D. Ketel, 1971-1976.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 


U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;


Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;


In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;


Vervolgens bevestigt u uw reservering door deze te versturen.
